import React from 'react'
import TabViews from '../components/TabViews/index'
import globalMessages from '../messages';
import { Helmet } from 'react-helmet';

export default {
  title: 'Tab Views',
  component: TabViews
}

export function TabViewsContainer() {

  const tabview = [
    <globalMessages.overview />,
    <globalMessages.reports />,
    <globalMessages.submissions />,
    <globalMessages.translations />,
    <globalMessages.preview />,
  ]

  const tabview2 = [<>Tab1</>, <>Tab2</>, <>Tab3</>]
  const tabview3 = ['Overview', 'Reports', 'Submissions', 'Translations',]

  const props = {
    currentTabValue: 0,
    tabChange: () => {},
    data: {},
    tabValues: tabview,
    indexChange: () => {},
    tabViews: [],
  };



  return (
    <div> 
      <h3>Example Tab</h3>
        <TabViews {...props}/>
    </div>
  )
}
